    the Ten Thousand Islands. Program funding came from South Florida Ecosystem Restoration.
    This project provided base-line data on the distribution and abundance of threatened
    and endangered sea turtles prior to the proposed redirection of Everglades fresh
    water flow. Tagging data are located on hard copy and electronic versions on CD.
